        WHEN 'DFAT' THEN 0.8160000000000001 WHEN 'IWV' THEN 3.8089999999999997 WHEN 'EUFN' THEN 2.3770000000000002 WHEN 'VTEB' THEN 0.547 WHEN 'FFLC' THEN 0.459 WHEN 'NUDM' THEN 3.769 WHEN 'VSS' THEN 4.684 WHEN 'BSCV' THEN 0.265 WHEN 'AMJB' THEN 1.851 WHEN 'KURE' THEN 0.184 WHEN 'SEIV' THEN 0.61 WHEN 'MAGS' THEN 0.146 WHEN 'DEW' THEN 2.232 WHEN 'SIXS' THEN 0.271 WHEN 'SCHX' THEN 0.286667 WHEN 'SJB' THEN 0.797 WHEN 'KIE' THEN 0.9249999999999999 WHEN 'FFR' THEN 1.568921 WHEN 'EURL' THEN 0.696 WHEN 'TLH' THEN 1.319
    END,
    updatedat = NOW()
    WHERE symbol IN ('DFAT', 'IWV', 'EUFN', 'VTEB', 'FFLC', 'NUDM', 'VSS', 'BSCV', 'AMJB', 'KURE', 'SEIV', 'MAGS', 'DEW', 'SIXS', 'SCHX', 'SJB', 'KIE', 'FFR', 'EURL', 'TLH');